import { StatusBar } from "expo-status-bar";
import { StyleSheet, Text, View, Image } from "react-native";
import Icon from "react-native-vector-icons/Octicons";
import FAIcon from "react-native-vector-icons/FontAwesome";

export default function App() {
  const name = "Julian Lund";
  let coffeeSaves = 1;
  let cashSave = coffeeSaves * 4.5;
  return (
    <View style={styles.container}>
      <View>
        <Text>Hello,</Text>
        <Text>{name}</Text>
        <Image source={require("./assets/coffee.png")} style={styles.image} />
      </View>
      <StatusBar style="auto" />
      <View>
        <Text>Coffee Saved</Text>
        <Text>{coffeeSaves}</Text>
        <Text>{`$${cashSave}`}</Text>
        <Text></Text>
      </View>
      <View>
        <Image
          source={require("./assets/QR_code_for_mobile_English_Wikipedia.svg")}
          style={styles.image}
        />
      </View>
      <View>
        <Icon.Button name="home"></Icon.Button>
        <Image
          source={require("./assets/card_icon.png")}
          style={styles.image}
        ></Image>
        <FAIcon.Button name="user-circle"></FAIcon.Button>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
  image: {
    width: 100,
    height: 100,
    borderRadius: 18,
  },
});
